import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 32.1-323.1 Department to submit forecast of expenditures.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-323.1.md","filePath":"vacode/32.1-323.1.md"}'),o={name:"vacode/32.1-323.1.md"},n=r('<h1 id="§-32-1-323-1-department-to-submit-forecast-of-expenditures" tabindex="-1">§ 32.1-323.1 Department to submit forecast of expenditures. <a class="header-anchor" href="#§-32-1-323-1-department-to-submit-forecast-of-expenditures" aria-label="Permalink to &quot;§ 32.1-323.1 Department to submit forecast of expenditures.&quot;">​</a></h1><p>By November 15 of each year, the Department of Planning and Budget, in cooperation with the Department of Medical Assistance Services, shall prepare and submit an estimate of Medicaid expenditures for the current year and a forecast of such expenditures for the next two years to the House Committees on Appropriations and Health, Welfare and Institutions and to the Senate Committees on Finance and Appropriations and on Education and Health, and to the Joint Legislative Audit and Review Commission.</p><p>1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0193" target="_blank" rel="noreferrer">193</a>; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0593" target="_blank" rel="noreferrer">593</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0605" target="_blank" rel="noreferrer">605</a>.</p>',3),i=[n];function s(c,d,p,f,l,_){return t(),a("div",null,i)}const u=e(o,[["render",s]]);export{h as __pageData,u as default};
